import React from 'react';

import './App.css';
import Login from './components/Login';

import SignUp from './components/SignUp';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";

function App() {
  return (

    <div>
      <Router>

        <Switch>

          <Route exact path='/'>


            </Route>
       <Route exact path="/">
           <SignUp />
       </Route>

       <Route exact path ="/login">

            <Login />
       </Route>
       </Switch>


       </Router>
    </div>

  )
}

export default App;
